<html><head><style>
      html, body { margin: 0; padding: 0; width: 100%; height: 100%; overflow: hidden; }
      *:focus { outline: 0.15vw solid #6366f1 !important; outline-offset: 0.1vw !important; }
      [data-editable="true"]:hover { background-color: rgba(99, 102, 241, 0.05); }
      [contenteditable]:hover { background-color: rgba(99, 102, 241, 0.05); cursor: text; }
      [contenteditable]:focus { background-color: rgba(99, 102, 241, 0.08); }
      /* Frame Logic:
         By default (unselected), frames are invisible (transparent) but interactive.
         When selected (data-selected="true"), they show the blue dashed border and bg.
      */
      [data-interaction-type="frame"] {
        cursor: pointer;
        border: 0.15vw dashed transparent;
        background-color: transparent;
        z-index: 100;
        position: absolute;
        pointer-events: auto;
      }

      /* Hover state to reveal hidden frames so user can find them */
      [data-interaction-type="frame"]:hover {
        background-color: rgba(0, 149, 255, 0.05) !important;
        border: 0.1vw dashed rgba(0, 149, 255, 0.3) !important;
      }

      [data-interaction-type="frame"][data-selected="true"] {
        border: 0.15vw dashed #0095FF !important;
        background-color: rgba(0, 149, 255, 0.1) !important;
        outline: none !important;
        cursor: move !important;
        z-index: 101;
      }

      .resize-handle { 
        position: absolute; 
        width: 0.6vw; 
        height: 0.6vw; 
        background: #6366f1; 
        border: 0.05vw solid white; 
        z-index: 10; 
        pointer-events: auto;
        display: none; /* Hidden by default */
      }

      /* Show handles only when frame is selected */
      [data-interaction-type="frame"][data-selected="true"] .resize-handle {
        display: block;
      }
      
      .resize-n { top: -0.3vw; left: 50%; cursor: n-resize; transform: translateX(-50%); }
      .resize-s { bottom: -0.3vw; left: 50%; cursor: s-resize; transform: translateX(-50%); }
      .resize-e { right: -0.3vw; top: 50%; cursor: e-resize; transform: translateY(-50%); }
      .resize-w { left: -0.3vw; top: 50%; cursor: w-resize; transform: translateY(-50%); }
      .resize-nw { top: -0.3vw; left: -0.3vw; cursor: nw-resize; }
      .resize-ne { top: -0.3vw; right: -0.3vw; cursor: ne-resize; }
      .resize-sw { bottom: -0.3vw; left: -0.3vw; cursor: sw-resize; }
      .resize-se { bottom: -0.3vw; right: -0.3vw; cursor: se-resize; }
      
      [data-interaction-type="frame"]::after {
        content: attr(data-interaction);
        position: absolute;
        top: 0.4vw;
        left: 0.4vw;
        background: rgba(99, 102, 241, 0.9);
        color: white;
        padding: 0.1vw 0.5vw;
        border-radius: 0.3vw;
        font-size: 0.6vw;
        font-weight: 700;
        pointer-events: none;
        text-transform: uppercase;
        letter-spacing: 0.03vw;
        box-shadow: 0 0.1vw 0.3vw rgba(0,0,0,0.1);
        z-index: 100;
        display: none; /* Hide label by default */
      }
      
      /* Show label only when selected or hovered */
      [data-interaction-type="frame"][data-selected="true"]::after,
      [data-interaction-type="frame"]:hover::after {
         display: block;
      }

      [data-interaction="none"]::after {
        display: none !important;
      }
    </style><style id="interaction-draw-style">* { cursor: crosshair !important; }</style></head><body style="cursor: crosshair; user-select: none;"><div style="width: 100%; height: 100%; margin: 0; padding: 0; overflow: hidden; background: white; display: flex; align-items: center; justify-content: center;"><img src="data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/4gHYSUNDX1BST0ZJTEUAAQEAAAHIAAAAAAQwAABtbnRyUkdCIFhZWiAH4AABAAEAAAAAAABhY3NwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQAA9tYAAQAAAADTLQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAlkZXNjAAAA8AAAACRyWFlaAAABFAAAABRnWFlaAAABKAAAABRiWFlaAAABPAAAABR3dHB0AAABUAAAABRyVFJDAAABZAAAAChnVFJDAAABZAAAAChiVFJDAAABZAAAAChjcHJ0AAABjAAAADxtbHVjAAAAAAAAAAEAAAAMZW5VUwAAAAgAAAAcAHMAUgBHAEJYWVogAAAAAAAAb6IAADj1AAADkFhZWiAAAAAAAABimQAAt4UAABjaWFlaIAAAAAAAACSgAAAPhAAAts9YWVogAAAAAAAA9tYAAQAAAADTLXBhcmEAAAAAAAQAAAACZmYAAPKnAAANWQAAE9AAAApbAAAAAAAAAABtbHVjAAAAAAAAAAEAAAAMZW5VUwAAACAAAAAcAEcAbwBvAGcAbABlACAASQBuAGMALgAgADIAMAAxADb/2wBDAAYEBQYFBAYGBQYHBwYIChAKCgkJChQODwwQFxQYGBcUFhYaHSUfGhsjHBYWICwgIyYnKSopGR8tMC0oMCUoKSj/2wBDAQcHBwoIChMKChMoGhYaKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCj/wAARCANgAlIDASIAAhEBAxEB/8QAHAABAAIDAQEBAAAAAAAAAAAAAAUGAwQHAggB/8QAXRAAAQMDAgIFBwUKCgYIBAcBAQACAwQFEQYSITEHE0FRYRQiMnGBkbEjQqHB0RUWMzQ1UmJyc7IXJDZTgpKiwuHwQ3SDk7PxCCUmVWOUo9InRVRkN0RldaTD4rT/xAAbAQEAAgMBAQAAAAAAAAAAAAAAAwUBAgQGB//EAEIRAAIBAgQCBggEBQMDBAMAAAABAgMRBBIhMQVBEzJRYXGBBiIzkaGxwfAUI2LRJEJScuEVNPEWkrJDosLSJVOC/9oADAMBAAIRAxEAPwCpoiL0ZyhERAEREAREQBERAEREAREQBERAFYaNvVWZvfIc/wCfcq8rTVt6qkgj/NAHuC0nyQRpIiLUyF+saXva0cycL8WxQt3VAJ5N4rDBHX+TdWNjB82NgHt/zhRizVsvXVUsn5zisKlSsrGAiIsgIiIAiIgCIiAIiIAiIgCIiAIiIAiIgCIiAIiIAiIgCIiAIiIAiIgJrT/mw1b+zAHxXperM0Ntc7iOJcR9AXlRPdmQiIgC93Y7LRE0fOcPrXhft/O2kp2+P1It0CCREUpgIiIAiIgCl7J+L1Z8AohTFobi31D+9wC1nsEZFs0zhDBPO7kxvD1rWXq7u6m2Rx/OkOT/AJ9yj30MkE4lzi5xySclfiIpjAREQBERAEREAREQBERAEREAREQBERAEREAREQHqNu+Rje8gK0XM/gwq7b2F9bC0fnBT9yOZgO4KOe6Mo1ERFgBZ2v6igqJuRxtafH/JW
